   SELECT (SELECT ZON_ID FROM ZON_ZONIFICACION WHERE ZON_COD ='01'), pef_id, (SELECT USU_ID FROM ${master.schema}.USU_USUARIOS WHERE USU_USERNAME='admin')
     FROM pef_perfiles
